import Link from "next/link";

const AboutPage = () => {
	return (
		<div>
			<ul>
				<li>
					<Link href='/'>
						<div>Home</div>
					</Link>
				</li>
				<li>
					<Link href='/about'>
						<div>About</div>
					</Link>
				</li>
			</ul>
			<h1>Welcome to the About Page</h1>
		</div>
	);
};

export default AboutPage;
